import React, { Component } from 'react';
import './Footer.css';
import Icon from './symitems.png'

class Footer extends Component {

  render() {
    return (
      <div className="footer">
        <img src={Icon} alt="" />
        <div className="footer-mail">
          symitems.info@gmail.com
        </div>
      </div>
    );
  }
}

export default Footer;
